import React, { Component } from 'react';

class WebPerformance extends Component {
    render() {
        return (
            <div>
                web performance
                <ul>
                    <li>light house</li>
                    <li>chrome audits</li>
                    <li>pingdom</li>
                    <li>sitechecker pro</li>
                    <li>pagespeed insights</li>
                    <li>webpagetest</li>
                </ul>
            </div>
        );
    }
}

export default WebPerformance;
